  const [token, setToken] = useState(null);
  console.log("token:"+token);


  if(token==null) {
    return <Login setToken={setToken} />

}


  return (
    <div className='App'>  

      <Router>
        <Routes>
        <Route path="/login" element={<LoginFormal />} />
